BEGIN TRANSACTION;
DROP TABLE IF EXISTS "app_users";
CREATE TABLE IF NOT EXISTS "app_users" (
	"id"	INTEGER,
	"username"	TEXT NOT NULL,
	"email"	TEXT,
	"password"	TEXT NOT NULL,
	"created_at"	DATETIME,
	"updated_at"	DATETIME,
	"deleted_at"	DATETIME,
	"name"	TEXT,
	"authToken"	TEXT,
	PRIMARY KEY("id")
);
DROP TABLE IF EXISTS "bgReadings";
CREATE TABLE IF NOT EXISTS "bgReadings" (
	"id"	INT,
	"device"	TEXT,
	"serial_number"	TEXT,
	"device_timestamp"	TEXT,
	"record_type"	NUMERIC,
	"historic_glucose_mmol_l"	mmol_l NUMERIC,
	"scan_glucose_mmol_l"	NUMERIC,
	"rapid_acting_insulin"	NUMERIC,
	"rapid_acting_insulin_units"	NUMERIC,
	"food"	NUMERIC,
	"carbohydrates_grams"	NUMERIC,
	"carbohydrates_servings"	NUMERIC,
	"long_acting_insulin"	NUMERIC,
	"long_acting_insulin_value_units"	NUMERIC,
	"notes"	NUMERIC,
	"strip_glucose_mmol_l"	NUMERIC,
	"ketone_mmol_l"	NUMERIC,
	"meal_insulin_units"	NUMERIC,
	"correction_insulin_unit"	NUMERIC,
	"user_change_insulin_units"	,
	"bg"	NUMERIC,
	PRIMARY KEY("id")
);
COMMIT;
